import { faCompass, faBookmark, faStar } from "@fortawesome/free-regular-svg-icons";
import { faFilter } from "@fortawesome/free-solid-svg-icons";
const SystemData = [
  {
    icon: faCompass,
    title: "Định vị",
    content:
      "Định vị thông minh cùng tính năng lọc theo điểm bán với vị trí gần nhất",
  },
  {
    icon: faBookmark,
    title: "Đề xuất",
    content:
      "Đề xuất những mặt hàng tốt nhất phù hợp nhu cầu và thói quen người dùng và giá thành sản phẩm",
  },
  {
    icon: faFilter,
    title: "Phân loại",
    content:
      "Bộ lọc và tìm kiếm thông minh dựa trên những tiêu chí thiết thực như: giá thành, vị trí,... đem lại lợi ích, thuận tiện cho khách hàng",
  },
  {
      icon: faStar,
      title: 'Đánh giá',
      content: 'Hiển thị đánh giá, xếp hạng, mức độ yêu thích chính xác giúp người dùng lựa chọn đúng đắn trong giao dịch'
  }
];

export {SystemData};
